(76, 'Sql Server Advanced Data Type', '', 4, '1', 5000, 6500, 'Deliver advanced functionality faster and cheaper by exploiting SQL Serverâ€™s ever-growing amount of built-in support for modern data formats. Learn about the growing support within SQL Server for operations and data transformations that have previously required third-party software and all the associated licensing and development costs. Benefit through a better understanding of what can be done inside the database engine with no additional costs or development time invested in outside software.\r\nWidely used types such as JSON and XML are well-supported by the database engine. The same is true of hierarchical data and even temporal data. Knowledge of these advanced types is crucial to unleashing the full power thatâ€™s available from your organizationâ€™s SQL Server database investment.\r\nSQL Server Advanced Data Types explores each of the complex data types supplied within SQL Server. Common usage scenarios for each complex data type are discussed, followed by a detailed discussion on how to work with each data type. Each chapter demystifies the complex data and you learn how to use the data types most efficiently.\r\nThe book offers a practical guide to working with complex data, using real-world examples to demonstrate how each data type can be leveraged. Performance considerations are also discussed, including the implementation of special indexes such as XML indexes and spatial indexes.\r\nWhat Youâ€™ll Learn\r\nUnderstand the implementation of basic data types and why using the correct type is so important\r\nWork with XML data through the XML data type\r\nConstruct XML data from relational result sets\r\nStore and manipulate JSON data using the JSON data type\r\nModel and analyze spatial data for geographic information systems\r\nDefine hierarchies and query them efficiently through the HierarchyID type\r\nWho This Book Is For\r\nSQL Server developers and application developers who need to store and access complex data structures', 'SQL-Server-Advanced-Data-Types.jpg', 'images.jpeg', '', '', '', 6, 5, 0, '2018-11-16 10:49:40', '2018-11-16 10:49:40'),
(77, 'Practical PHP 7, MySQL 8, and MariaDB Website Databases, 2nd Edition', '', 4, '1', 7000, 10000, 'Build interactive, database-driven websites with PHP 7, MySQL 8, and MariaDB. The focus of this book is on getting you up and running as quickly as possible with real-world applications. In the first two chapters, you will set up your development and testing environment, and then build your first PHP and MariaDB or MySQL database-driven website. You will then increase its sophistication, security, and functionality throughout the course of the book.\r\nThe PHP required is taught in context within each project so you can quickly learn how PHP integrates with MariaDB and MySQL to create powerful database-driven websites.\r\nEach project is fully illustrated, so you will see clearly what you are building as you create your own database-driven website. You will build a form for registering users, and then build an interface so that an administrator can view and administer the user database. You will create a message board for users and a method for emailing them. You will also learn the best practices for ensuring that your website databases are secure. Later chapters describe how to create a product catalog, and a simple e-commerce site. You will also discover how to migrate a database to a remote host. The final chapter will demonstrate the advantages of migrating to Oracleâ€™s MySQL 8. You will be shown step by step migration directions along with a demonstration of the tools available in SQL Workbench.\r\nBecause you are building the interactive pages yourself, you will know exactly how MySQL, MariaDB, and PHP all work together, and you will be able to add database interactivity to your own websites with ease.\r\nWhat You Will Learn\r\nBuild a secure database-driven website using PHP 7, MySQL 8, and MariaDB\r\nCreate a product catalog\r\nWrite a message board\r\nMove towards e-commerce\r\nEmploy security and validation measures\r\nMigrate to Oracleâ€™s MySQL 8 Server platform\r\nWho This Book Is For\r\nWeb developers with HTML, CSS and a limited Bootstrap experience. Readers need little to no prior experience with PHP and MySQL', 'Practical-PHP-7-MySQL-8-and-MariaDB-Website-Databases.jpg', '', '', '', '', 6, 6, 0, '2018-11-16 10:58:21', '2018-11-16 10:58:21'),
